package ua.ksstroy.converter.zoneGroup;import ua.ksstroy.converter.Converter;import ua.ksstroy.logic.zoneGroup.ZoneGroup;import ua.ksstroy.logic.zoneGroup.ZoneGroupImpl;import ua.ksstroy.models.zone.GroupsModel;public class GroupsModelToGroupConverter implements Converter<GroupsModel, ZoneGroup> {    public ZoneGroup convert(GroupsModel group) {        ZoneGroup zoneGroup = new ZoneGroupImpl();        zoneGroup.setId(group.getId());        zoneGroup.setName(group.getName());        return zoneGroup;    }}